package jump_game_4

import "testing"

type testData struct {
	s        string
	minJump  int
	maxJump  int
	expected bool
}

var longS = ""

func TestJG(t *testing.T) {
	tds := []testData{
		{
			s:        "011010",
			minJump:  2,
			maxJump:  3,
			expected: true,
		},
		{
			s:        "01101110",
			minJump:  2,
			maxJump:  3,
			expected: false,
		},
		{
			s:        "0100000000000",
			minJump:  1,
			maxJump:  1,
			expected: false,
		},
		{
			s:        "001",
			minJump:  10,
			maxJump:  10,
			expected: false,
		},
		{
			"0000000000",
			8,
			8,
			false,
		},
		{
			longS,
			5,
			99998,
			true,
		},
		{
			"0100100010",
			3,
			4,
			true,
		},
	}

	for i, td := range tds {
		r := canReachTPDep(td.s, td.minJump, td.maxJump)
		if r != td.expected {
			t.Fatalf("index %d expect %v got %v", i, td.expected, r)
		}
	}
}
